import React from 'react'

// import link
import { Link } from 'react-router-dom'
// import images
import intLOGO from '../../assets/images/interactlogo.SVG'
// import components

const Header = () => {
  return (
    <>
    <div className="flex justify-between items-center h-20">
      <div className="">
          {/* logo */}
          <Link to='/'>
            <img src={intLOGO} alt="" />
          </Link>
      </div>
    </div>
    
    </>
  )
}

export default Header
